import React, { Component } from "react";

class ShortVisitComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      begin_date: "20-12-2019 05:00",
      visited: this.props.visited,
      inst: this.props.inst,
    };
  }
  render() {
    return (
      <span
        className="card border shadow p-3 mb-5 bg-white rounded position=relative"
        style={{ width: 500 }}
      >
        <div>
          <p>
            <b>Instituição:</b> {this.state.inst}
          </p>
          <p>
            <b>Hora Entrada:</b> {this.state.begin_date}
          </p>
        </div>
      </span>
    );
  }
}

export default ShortVisitComponent;
